This holiday season I’d love to shine the light on an organization that I love called @AlexandriaHouseLA, a non profit that has provided shelter, childcare, counseling and job readiness for hundreds of homeless women and their children for the past 25 years in Los Angeles. You might remember I visited about 5 years ago where we filmed the visit for KUTWK which inspired a single donor who was watching to generously donate $1M to them. 

This week Khloe & I returned and met with the incredible women & their children that are currently in Alexandria’s transitional home & programs to see how the organization has grown. We were also able to provide many essentials they would need this holiday season along with a beauty day & family portraits with their families and head shots for job interviews. We also met with women in Start Up Sisterhood, a program that helps give these women the tools and mentorship they need to start their own small businesses. 

We are so grateful to their openness in sharing their personal stories of perseverance with us. It truly takes a village and thru the support of community organizations such as Alexandria House, we can make the difference in so many lives by spreading the awareness of the important work they are doing and shining a light on these women. I encourage you to learn more about Alexandria House by visiting https://www.alexandriahouse.org 

